script: |
  super -f text -I q10307.spq | sort > q10307.out

inputs:
  - name: q10307.spq
    data: |
      SELECT ALL 60 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE - col1 NOT BETWEEN col2 AND ( col1 * + 3 );
  - name: tab2

outputs:
  - name: q10307.out
    data: |
      60
      60
      60
